import React, { Component } from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';
import { MDBBtn, MDBBtnGroup } from 'mdbreact';

class RightSidebar extends Component {

  state = {
    house: [],
    selectedMovie: null
  }

  componentDidMount() {
    fetch('https://oko-api.herokuapp.com/dwelling/house/', {
      method: 'GET',
      headers: {
        //'Authorization': 'Token 53aaf969d1e6ee660f11a9cb99da97338232d86e'
      }
    }).then(resp => resp.json())
      .then(resp => this.setState({house: resp}))
      .catch(error => console.log(error))
  }

  houseClicked = h => {
    console.log(h)
  }

  render() {
    return (
      <React.Fragment>
        <table className="sidebar-right">
          <tbody>
            <tr className='text-center' header='Outline'>
              <MDBBtnGroup size='lg' className="sidebarButtons">
                <MDBBtn outline color='default'>
                  Money Saved
                </MDBBtn>
              </MDBBtnGroup>
            </tr>
            <tr className='text-center' header='Outline'>
              <MDBBtnGroup size='lg' className="sidebarButtons">
                <MDBBtn outline color='default'>
                  My Home
                </MDBBtn>
              </MDBBtnGroup>
            </tr>
            <tr className='text-center' header='Outline'>
              <MDBBtnGroup size='lg' className="sidebarButtons">
                <MDBBtn outline color='default'>
                  My Score
                </MDBBtn>
              </MDBBtnGroup>
            </tr>
            <tr className='text-center' header='Outline'>
              <MDBBtnGroup size='lg' className="sidebarButtons">
                <MDBBtn outline color='default'>
                  My Rank
                </MDBBtn>
              </MDBBtnGroup>
            </tr>
          </tbody>
        </table>
      </React.Fragment>
    );
  }
}

export default RightSidebar;
